import React from 'react';
import Header from './Header';
import Footer from './footer';


const Layout = () =>{
    return(
        <div id='wrapper'>
            <div id="content-wrapper">
                <div id="content">
                    <Header />
                    <p>sad</p>
                    <Footer/>
                </div>  
            </div>   
        </div>
    );
};

export default Layout;
